package conditionalStatements;

public class FIndGreatestEqualSmaller {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1 = 90;
		int num2 = 100;
		
		// Print greater than, less than or equal to if- else if - else
		if (num1 > num2) {
			System.out.println("num1 > num2");
		}
		else if (num1 == num2) {
			System.out.println("num1 = num2");
		}
		else  {
			System.out.println("num1<num2");

		}

	}

}
